import "./App.css";
import CarouselComp from "./components/CarouselComp";
import NavbarComp from "./components/NavbarComp";

function App() {
  return (
    <>
      <NavbarComp />
      <CarouselComp />
      <Feedback />
    </>
  );
}

export default App;
